"use strict";
// Manipulando tipos de parametros em funções
/// tipos de retornos 
const sum = (x, y) => {
    return (x + y).toString();
};
const value = sum(5, 5);
//VOID é uma função que não retorna nenhum valor
const log = (message) => {
    console.log(message);
};
const summ = (x, y) => {
    return (x + y);
};
const valor = summ(5, 5);
const sub = (x, y) => {
    return x - y;
};
